using Microsoft.EntityFrameworkCore;
using MovieRating.Data;
using SharedLibrary;

namespace MovieRating.Services
{
    public class MovieService : IMovieService
    {
        private readonly ApplicationDbContext _db;

        public MovieService(ApplicationDbContext db)
        {
            _db = db;
        }

        public async Task<Movie> CreateMovie(Movie movie)
        {
            var result = await _db.Movies.AddAsync(movie);
            await _db.SaveChangesAsync();
            return result.Entity;
        }

        public async Task<Movie> GetMovieById(int id)
        {
            try
            {
                var movie = await _db.Movies.FindAsync(id);

                return movie;
            }
            catch (Exception)
            {
                return null;
            }
        }

        public async Task<List<Movie>> GetMovies()
        {
            var movies = await _db.Movies.ToListAsync();
            return movies;
        }

        public async Task CreateInitialMovies()
        {
            var movie = new Movie();
            movie.Title = "Hulk";
            movie.Url = "Hulk";
            movie.Image = "data:image/png;base64,";
            movie.ReleaseYear = "2003";
            movie.Description = "Bruce Banner, a genetics researcher with a tragic past, suffers an accident that causes him to transform into a raging green monster when he gets angry.";

            var movie2 = new Movie();
            movie2.Title = "IronMan";
            movie2.Url = "ironman";
            movie2.Image = "data:image/png;base64,";
            movie2.ReleaseYear = "2008";
            movie2.Description = "After being held captive in an Afghan cave, billionaire engineer Tony Stark creates a unique weaponized suit of armor to fight evil.";

            await _db.Movies.AddAsync(movie);
            await _db.Movies.AddAsync(movie2);
            await _db.SaveChangesAsync();
        }
    }
}
